	public static String removeDuplicates(String S) {
		if (S.equals(""))
			return "";
		LinkedList<Character> c= new LinkedList<>();
		c.push(S.charAt(0));
		for (int i = 1; i < S.length(); i++) {
			if (c.isEmpty()){
				c.push(S.charAt(i));
				continue;
			}
			if (c.peek()==S.charAt(i))c.pop();
			else c.push(S.charAt(i));
		}
		String s="";
		while (!c.isEmpty()){
			s=c.peek()+s;
			c.pop();
		}

		return s;
	}
