	public static boolean searchMatrix(int[][] matrix, int target) {
		if(matrix.length==0)return false;
		int n=0,m=matrix[0].length-1;
		while (n<matrix.length && m>=0){
			if (matrix[n][m]>target){
				m--;
			}else if (matrix[n][m]<target){
				n++;
			}else return true;
		}
		return false;
	}
	public static int findMin(int[] nums) {
		int L=0,R=nums.length-1;
		int mid=(L+R)>>>1;
		while (L<=R){
			mid=(L+R)>>>1;
			if (mid<nums.length-1 && nums[mid]>nums[mid+1]){
				return mid+1;
			}else if (nums[mid]>nums[nums.length-1]){
				L=mid+1;
			}else {
				R=mid-1;
			}
		}
		return L;
	}
	// 绿色二分模板
	public int hIndex1(int[] citations) {

		int L=0,R=citations.length;
		int mid=(L+R)>>>1;
		while(L<R){
			mid=(L+R+1)>>>1;
			if(citations[citations.length-mid]>=mid)L=mid;
			else R=mid-1;
		}
		return R;
	}
	// 红色二分模板
	public int hIndex2(int[] citations) {

		int L=0,R=citations.length;
		int mid=(L+R)>>>1;
		while(L<R){
			mid=(L+R)>>>1;
			if(citations[citations.length-mid]>=mid)L=mid+1;
			else R=mid;
		}
		return R;
	}
	public static int search(int[] nums, int target) {
		int bet=findMin(nums);
		int L=0,R=bet-1;
		int mid=(L+R)>>>1;
		while (L<=R){
			mid=(L+R)>>>1;
			if (nums[mid]==target)return mid;
			else if (nums[mid]>target){
				R=mid-1;
			}else L=mid+1;
		}
		L=bet;
		R=nums.length-1;
		mid=(L+R)>>>1;
		while (L<=R){
			mid=(L+R)>>>1;
			if (nums[mid]==target)return mid;
			else if (nums[mid]>target){
				R=mid-1;
			}else L=mid+1;
		}
		return -1;
	}
	public static ListNode swapPairs(ListNode head) {
		ListNode helper=new ListNode(-1);
		ListNode ans=head.next;
		helper.next=head;
		ListNode p=head.next;
		while(helper.next != null && helper.next.next!=null){
			head.next=head.next.next;
			p.next=head;
			helper.next=p;
			helper=helper.next;
			helper=helper.next;
			if(p.next != null && p.next.next!=null && p.next.next.next!=null)
				p=p.next.next.next;
			head=head.next;
		}
		return ans;
	}
