	public static int[] numSmallerByFrequency(String[] queries, String[] words) {
		int wordNum[]=new int[words.length];
		for (int i = 0; i < words.length; i++) {
			char[] chars = words[i].toCharArray();
			Arrays.sort(chars);
			int count=1;
			for (int j = 0; j <chars.length-1; j++) {
				if (chars[j]==chars[j+1]){
					count++;
				}else break;
			}
			wordNum[i]=count;
		}
		Arrays.sort(wordNum);
		int queryNum[]=new int[queries.length];
		for (int i = 0; i < queries.length; i++) {
			char[] chars = queries[i].toCharArray();
			Arrays.sort(chars);
			int count=1;
			for (int j = 0; j <chars.length-1; j++) {
				if (chars[j]==chars[j+1]){
					count++;
				}else break;
			}
			queryNum[i]=count;
		}
		int ans[]=new int[queries.length];
		for (int i = 0; i < queries.length; i++) {
			int temp=0;
			for (int j = wordNum.length-1; j >=0 ; j--) {
				if (wordNum[j]>queryNum[i]){
					temp++;
				}else break;
			}
			ans[i]=temp;
		}
		return ans;
	}
	//快速排序
	void quick_sort(int s[], int l, int r) {
		if (l < r)
		{
			//Swap(s[l], s[(l + r) / 2]); //将中间的这个数和第一个数交换 参见注1
			int i = l, j = r, x = s[l];
			while (i < j)
			{
				while(i < j && s[j] >= x) // 从右向左找第一个小于x的数
					j--;
				if(i < j)
					s[i++] = s[j];

				while(i < j && s[i] < x) // 从左向右找第一个大于等于x的数
					i++;
				if(i < j)
					s[j--] = s[i];
			}
			s[i] = x;
			quick_sort(s, l, i - 1); // 递归调用
			quick_sort(s, i + 1, r);
		}
	}


	public List<List<String>> groupAnagrams(String[] strs) {
		List<List<String>> ans = new ArrayList<>();
		List<String> dist=new ArrayList<>();
		for (int i = 0; i < strs.length; i++) {
			char[] chars = strs[i].toCharArray();
			Arrays.sort(chars);
			StringBuilder sb=new StringBuilder();
			for (int j = 0; j < chars.length; j++) {
				sb.append(chars[i]);
			}
			dist.add(sb.toString());
		}
		for (int i = 0; i < strs.length; i++) {
			List<String> temp=new ArrayList<>();
			if (!strs[i].equals("-1")){
				temp.add(strs[i]);
			}else continue;
			for (int j = i+1; j <strs.length; j++) {
				if (dist.get(i).equals(dist.get(j))){
					temp.add(strs[j]);
					strs[j]="-1";
				}
			}
			ans.add(temp);
		}
		return ans;
	}
