	public static int clumsy(int N) {
		int ans=0;
		Stack<Integer> stack=new Stack<>();
		Stack<Character> pot=new Stack<>();
		for (int i = 0; i <N-1; i++) {
			if (i%4==0){
				stack.push(N-i);
				int c=stack.pop();
				stack.push(c*(N-i-1));
			}else if (i%4==1){
				int c=stack.pop();
				stack.push(c/(N-i-1));
			}else if (i%4==2){
				pot.push('+');
			}else {
				stack.push(N-i);
				pot.push('-');
			}
		}
		if (stack.size()==pot.size())stack.push(1);
		Stack<Integer> s1=new Stack<>();
		Stack<Character> s2=new Stack<>();
		while (stack.size()>0)s1.push(stack.pop());
		while (pot.size()>0)s2.push(pot.pop());
		while (s2.size()>0){
			int t1=s1.pop();
			int t2=s1.pop();
			if (s2.peek()=='+'){
				s2.pop();
				s1.push(t1+t2);
			}else if (s2.peek()=='-'){
				s2.pop();
				s1.push(t1-t2);
			}
		}
		return s1.peek();
	}
