	public static int numPrimeArrangements(int n) {
		int perm=0;
		int m=1000000007;
		for (int i = 2; i <=n ; i++) {
			int flag=0;
			for (int j = 2; j <=Math.sqrt(i) ; j++) {
				if (i%j==0){
					flag=1;
					break;
				}
			}
			if (flag==0)perm++;
		}
		long ans=1;
		for (int i = 1; i <=perm; i++) {
			ans=(ans*i)%m;
		}
		for (int i = 1; i <=n-perm; i++) {
			ans=(ans*i)%m;
		}
		return (int)ans;

	}
