	public static int findTargetSumWays(int[] nums, int S) {
		int ans=0;
		int sum=0;
		for (int i = 0; i < nums.length; i++) {
			sum+=nums[i];
		}
		int dp[][]=new int[nums.length+1][sum*2+1];
		dp[0][sum]=1;
		for (int i = 0; i < nums.length; i++) {
			for (int j = nums[i]; j <= 2*sum -nums[i]; j++) {
				dp[i+1][j+nums[i]]+=dp[i][j];
				dp[i+1][j-nums[i]]+=dp[i][j];
			}
		}
		return dp[nums.length][S+sum];
	}
