	public static void setZeroes(int[][] matrix) {
		Map<Integer,List<Integer>> dict = new HashMap<>();
		for (int i = 0; i < matrix.length; i++) {
			for (int j = 0; j < matrix[0].length; j++) {
				if (matrix[i][j]==0){
					if (dict.containsKey(i)){
						dict.get(i).add(j);
					}else {
						List<Integer> list =new ArrayList<>();
						list.add(j);
						dict.put(i,list);
					}
				}
			}
		}
		dict.forEach((k,v)->{
			Arrays.fill(matrix[k],0);
			v.forEach(pageNum -> {
				for (int i = 0; i < matrix.length; i++) {
					matrix[i][pageNum]=0;
				}
			});
		});
	}
	public boolean isPalindrome(String s) {
		StringBuilder s1= new StringBuilder();
		StringBuilder s2= new StringBuilder();
		String s3 = s.toUpperCase();
		int n =s3.length();
		for (int i = 0; i < n; i++) {
			if (s3.charAt(i)>='A' && s3.charAt(i)<='Z' || s3.charAt(i)>='0' && s3.charAt(i)<='9'){
				s1.append(s3.charAt(i));
			}
			if (s3.charAt(n-1-i)>='A' && s3.charAt(n-1-i)<='Z' || s3.charAt(n-1-i)>='0' && s3.charAt(n-1-i)<='9'){
				s2.append(s3.charAt(n-1-i));
			}
		}
		return s1.toString().equals(s2.toString())?true:false;
	}
	public int canCompleteCircuit(int[] gas, int[] cost) {
		int n = gas.length;
		int dit[] = new int[n];
		for (int i = 0; i < n; i++) {
			dit[i]=gas[i]-cost[i];
		}
		int ans = 0;
		int jh = 0;
		int flag = 0;
		boolean can = true;
		while (flag<n){
			jh=0;
			can = true;
			ans=flag;
			while (ans<n && can ==true){
				jh+=dit[ans++];
          				if (jh<0) {
					can=false;
				}
			}
			ans =0;
			while (ans<flag && can ==true){
				jh+=dit[ans++];
				if (jh<0) {
					can=false;
				}
			}
			if (can)return flag;
			flag++;
		}
		return -1;
	}
