	public int smallestDivisor(int[] nums, int threshold) {
		int n = nums.length;
		long temp = 0;
		int max = 0;
		for (int i = 0; i < n; i++)
			if (max<nums[i]) max = nums[i];
		int left = 1, right = max;
		int mid = 0;
		while (left<right){
			mid = (left+right)>>1;
			temp = 0;
			for (int i = 0; i < n; i++) {
				temp = temp + nums[i]/mid + (nums[i]%mid==0?0:1);
			}
			if (temp>threshold){
				left = mid;
			}else {
				right = mid;
			}
		}
		return left;
	}
	public List<List<Integer>> levelOrder(TreeNode root) {
		List<List<Integer>> ans = new ArrayList<>();
		Queue<TreeNode> queue = new LinkedList<>();
		queue.offer(root);
		while (!queue.isEmpty()){
			int size = queue.size();
			List<Integer> t = new ArrayList<>();
			for (int i = 0; i < size; i++) {
				TreeNode poll = queue.poll();
				t.add(poll.val);
				if (poll.left!=null)queue.offer(poll.left);
				if (poll.right!=null)queue.offer(poll.right);
			}
			ans.add(t);
		}
		return ans;
	}
	public int ladderLengthForBfs(String beginWord, String endWord, List<String> wordList) {
		if (!wordList.contains(endWord)){
			return 0;
		}
		int level = 0;
		int n = wordList.size();
		Queue<String> queue = new LinkedList<>();
		queue.offer(beginWord);
		while (!queue.isEmpty()){
			++level;
			int tempSize = queue.size();
			for (int i = 0; i < tempSize; i++) {
				StringBuilder word = new StringBuilder(queue.poll());
				for (int j = 0; j < word.length(); j++) {
					char orig_char = word.charAt(j);
					for (char k = 'a'; k <= 'z'; k++) {
						word.replace(j,j+1,k+"");
						if (word.toString().equals(endWord))return level+1;
						if (!wordList.contains(word.toString())) continue;
						wordList.remove(word.toString());
						queue.offer(word.toString());
					}
					word.replace(j,j+1,orig_char+"");
				}
			}
		}
		return 0;
	}
	public int evalRPN(String[] tokens) {
		int n = tokens.length;
		//Stack<Character> ysf = new Stack<>();
		Stack<Integer> czs = new Stack<>();
		for (int i = 0; i < n; i++) {
			if (tokens[i].equals("+")){
				Integer pop = czs.pop();
				Integer pop1 = czs.pop();
				czs.push(pop+pop1);
			}else if (tokens[i].equals("-")){
				Integer pop = czs.pop();
				Integer pop1 = czs.pop();
				czs.push(pop-pop1);
			}else if (tokens[i].equals("*")){
				Integer pop = czs.pop();
				Integer pop1 = czs.pop();
				czs.push(pop*pop1);
			}else if (tokens[i].equals("/")){
				Integer pop = czs.pop();
				Integer pop1 = czs.pop();
				czs.push(pop/pop1);
			}else {
				czs.push(Integer.parseInt(tokens[i]));
			}
		}
		return czs.peek();
	}
	public String simplifyPath(String path) {
		String[] split = path.split("/");
		Stack<String> ans = new Stack<>();
		for (int i = 0; i < split.length; i++) {
			if (!split[i].equals("") && !split[i].equals(".")){
				if (split[i].charAt(0)=='.' ){
					for (int j = 1; j < split[i].length() && !ans.isEmpty(); j++) {
						ans.pop();
					}
				}else {
					ans.push(split[i]);
				}
			}
		}
		if (ans.isEmpty())return "/";
		StringBuilder sb = new StringBuilder();
		while (!ans.isEmpty()){
			sb.insert(0,'/'+ans.pop());
		}
		return sb.toString();
	}

