	public int removeCoveredIntervals(int[][] intervals) {
		int n = intervals.length;
		boolean visited[] = new boolean[n];
		int ans = 0;
		for (int i = 0; i < n; i++) {
			for (int j = 0; j < n; j++) {
				if (i==j || visited[j])continue;
				if (intervals[j][0]<=intervals[i][0] && intervals[j][1]>=intervals[i][1]){
					ans++;
					visited[i] = true;
					break;
				}
			}
		}
		return n-ans;
	}
