	public int numOfSubarrays(int[] arr, int k, int threshold) {
		//Arrays.sort(arr);
		if (arr.length<k)return 0;
		int left = 0,right=k-1;
		int sum=0;
		for (int i = 0; i < k; i++) {
			sum+=arr[i];
		}
		int ans =0;
		if (sum*1.0/k>=threshold){
			ans++;
		}
		while (right<arr.length-1){
			sum-=arr[left++];
			sum+=arr[++right];
			if (sum*1.0/k>=threshold){
				ans++;
			}
		}
		return ans;
	}
